import React, { useState, useEffect } from "react";
import { Navbar } from "../index";
import "./ShippingRates.css";

function Estimation() {
  const [provincesData, setProvincesData] = useState([]);
  const [formData, setFormData] = useState({
    Province_Origin: "กรุงเทพมหานคร",
    Province_Origin_Code: "10", // Assuming the initial code
    Province_Destination: "กรุงเทพมหานคร",
    Province_Destination_Code: "10", // Assuming the initial code
    Select_Package: "box",
    Width: "0",
    Height: "0",
    Length: "0",
    Weight: "0",
  });

  useEffect(() => {
    fetchProvinces();
  }, []);

  const fetchProvinces = () => {
    fetch("http://localhost:3333/Shipping")
      .then((response) => response.json())
      .then((data) => {
        if (data.status === "ok") {
          setProvincesData(data.provinces);
          console.log("Provinces data:", data.provinces);
        } else {
          console.error("Error fetching provinces:", data.message);
        }
      })
      .catch((error) => {
        console.error("Error fetching provinces:", error);
      });
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    let code = "";
    if (name === "Province_Origin") {
      const selectedProvince = provincesData.find(
        (province) => province.name_th === value
      );
      if (selectedProvince) {
        code = selectedProvince.code;
      }
    }
    setFormData({
      ...formData,
      [name]: value,
      Province_Origin_Code: code,
    });
  };
  const handleCalculate = () => {
    console.log("Form Data:", formData);
  };
  return (
    <div>
      <Navbar />
      <div className="Shipping-container">
        <div className="Shipping-form-container">
          <form>
            <h1>Shipping Rates</h1>
            <span>estimate your parcel delivery fee</span>
            <br />
            <br />
            <div className="group">
              <div className="form-group row">
                <label
                  htmlFor="Province_Origin"
                  className="col-sm-4 col-form-label"
                >
                  <span className="lb_IDCard">Province origin</span>
                </label>
                <div className="enterdata">
                  <select
                    id="Province_Origin"
                    name="Province_Origin"
                    value={formData.Province_Origin} // Use formData.Province_Origin
                    onChange={handleInputChange}
                  >
                    {provinces.map((province) => (
                      <option key={province.id} value={province.name_th}>
                        {province.name_th}
                      </option>
                    ))}
                  </select>
                </div>
              </div>
              <div className="form-group row">
                <label
                  htmlFor="Province_Destination"
                  className="col-sm-4 col-form-label"
                >
                  <span className="lb_IDCard">Province destination</span>
                </label>
                <div className="enterdata">
                  <select
                    id="Province_Destination"
                    name="Province_Destination"
                    value={formData.Province_Destination} // Use formData.Province_Destination
                    onChange={handleInputChange}
                  >
                    {provinces.map((province) => (
                      <option key={province.id} value={province.name_th}>
                        {province.name_th}
                      </option>
                    ))}
                  </select>
                </div>
              </div>
            </div>

            <br />
            <div className="form-group row">
              <label
                htmlFor="Select_Package"
                className="col-sm-4 col-form-label"
              >
                <span className="lb_IDCard">Select package</span>
              </label>
              <div className="enterdata">
                <select
                  id="Select_Package"
                  name="Select_Package"
                  value={formData.Select_Package} // Use formData.Select_Package
                  onChange={handleInputChange}
                >
                  <option value="box">box</option>
                  <option value="seal bag">seal bag</option>
                  <option value="envelope">envelope</option>
                </select>
              </div>
            </div>
            <br />
            <div className="group2">
              <div className="form-group row">
                <label htmlFor="Width" className="col-sm-4 col-form-label">
                  <span className="lb_IDCard">Width (cm.)</span>
                </label>
                <div className="enterdata">
                  <input
                    type="text"
                    id="Width"
                    name="Width"
                    value={formData.Width}
                    onChange={handleInputChange}
                    placeholder="Parcel width"
                  />
                </div>
              </div>
              <div className="form-group row">
                <label htmlFor="Height" className="col-sm-4 col-form-label">
                  <span className="lb_IDCard">Height (cm.)</span>
                </label>
                <div className="enterdata">
                  <input
                    type="text"
                    id="Height"
                    name="Height"
                    value={formData.Height}
                    onChange={handleInputChange}
                    placeholder="Parcel height"
                  />
                </div>
              </div>
              <div className="form-group row">
                <label htmlFor="Length" className="col-sm-4 col-form-label">
                  <span className="lb_IDCard">Length (cm.)</span>
                </label>
                <div className="enterdata">
                  <input
                    type="text"
                    id="Length"
                    name="Length"
                    value={formData.Length}
                    onChange={handleInputChange}
                    placeholder="Parcel length"
                  />
                </div>
              </div>
              <div className="form-group row">
                <label htmlFor="Weight" className="col-sm-4 col-form-label">
                  <span className="lb_IDCard">Weight (kg.)</span>
                </label>
                <div className="enterdata">
                  <input
                    type="text"
                    id="Weight"
                    name="Weight"
                    value={formData.Weight}
                    onChange={handleInputChange}
                    placeholder="Parcel weight"
                  />
                </div>
              </div>
            </div>
            <br />
            <br />
            <label htmlFor="deliveryFee" className="c">
              <span>Delivery fee</span>{" "}
              <span className="deliveryFeeValue"> xxx </span>
              <span> bath</span>
            </label>
            <br />
            <br />
            <button type="button" onClick={handleCalculate}>
              Calculate
            </button>
          </form>
        </div>
      </div>
    </div>
  );
}

export default Estimation;
